import React, { useState } from "react";
import "./InfiniteCanvas.css";

// Widget card templates with high-quality background images
const cardTemplates = [
  { 
    img: "https://images.unsplash.com/photo-1635070041078-e363dbe005cb?w=400&h=400&fit=crop&crop=entropy", 
    title: "Mathematics",
    subtitle: "Advanced Calculus"
  },
  { 
    img: "https://images.unsplash.com/photo-1461749280684-dccba630e2f6?w=400&h=400&fit=crop&crop=entropy", 
    title: "Programming",
    subtitle: "Code & Logic"
  },
  { 
    img: "https://images.unsplash.com/photo-1507003211169-0a1dd7228f2d?w=400&h=400&fit=crop&crop=entropy", 
    title: "Languages",
    subtitle: "Global Communication"
  },
  { 
    img: "https://images.unsplash.com/photo-1481627834876-b7833e8f5570?w=400&h=400&fit=crop&crop=entropy", 
    title: "History",
    subtitle: "Ancient Wisdom"
  },
  { 
    img: "https://images.unsplash.com/photo-1636466497217-26a8cbeaf0aa?w=400&h=400&fit=crop&crop=entropy", 
    title: "Physics",
    subtitle: "Quantum Mechanics"
  },
  { 
    img: "https://images.unsplash.com/photo-1532094349884-543bc11b234d?w=400&h=400&fit=crop&crop=entropy", 
    title: "Chemistry",
    subtitle: "Molecular Science"
  },
  { 
    img: "https://images.unsplash.com/photo-1509228468518-180dd4864904?w=400&h=400&fit=crop&crop=entropy", 
    title: "Geometry",
    subtitle: "Sacred Patterns"
  },
  { 
    img: "https://images.unsplash.com/photo-1493225457124-a3eb161ffa5f?w=400&h=400&fit=crop&crop=entropy", 
    title: "Music",
    subtitle: "Audio Production"
  },
  { 
    img: "https://images.unsplash.com/photo-1446776653964-20c1d3a81b06?w=400&h=400&fit=crop&crop=entropy", 
    title: "Astronomy",
    subtitle: "Space & Stars"
  },
  { 
    img: "https://images.unsplash.com/photo-1611974789855-9c2a0a7236a3?w=400&h=400&fit=crop&crop=entropy", 
    title: "Finance",
    subtitle: "Market Analytics"
  },
  { 
    img: "https://images.unsplash.com/photo-1518709268805-4e9042af2176?w=400&h=400&fit=crop&crop=entropy", 
    title: "Technology",
    subtitle: "Digital Innovation"
  },
  { 
    img: "https://images.unsplash.com/photo-1559757148-5c350d0d3c56?w=400&h=400&fit=crop&crop=entropy", 
    title: "Health",
    subtitle: "Wellness & Fitness"
  },
  { 
    img: "https://images.unsplash.com/photo-1571019613454-1cb2f99b2d8b?w=400&h=400&fit=crop&crop=entropy", 
    title: "Sports",
    subtitle: "Athletic Performance"
  },
  { 
    img: "https://images.unsplash.com/photo-1541961017774-22349e4a1262?w=400&h=400&fit=crop&crop=entropy", 
    title: "Art",
    subtitle: "Creative Expression"
  },
  { 
    img: "https://images.unsplash.com/photo-1558655146-d09347e92766?w=400&h=400&fit=crop&crop=entropy", 
    title: "Design",
    subtitle: "Visual Aesthetics"
  },
  { 
    img: "https://images.unsplash.com/photo-1507679799987-c73779587ccf?w=400&h=400&fit=crop&crop=entropy", 
    title: "Business",
    subtitle: "Strategic Growth"
  },
  { 
    img: "https://images.unsplash.com/photo-1559757175-0eb30cd8c063?w=400&h=400&fit=crop&crop=entropy", 
    title: "Psychology",
    subtitle: "Mind & Behavior"
  },
  { 
    img: "https://images.unsplash.com/photo-1529156069898-49953e39b3ac?w=400&h=400&fit=crop&crop=entropy", 
    title: "Social",
    subtitle: "Human Connection"
  },
  { 
    img: "https://images.unsplash.com/photo-1556909114-f6e7ad7d3136?w=400&h=400&fit=crop&crop=entropy", 
    title: "Cooking",
    subtitle: "Culinary Arts"
  },
  { 
    img: "https://images.unsplash.com/photo-1488646953014-85cb44e25828?w=400&h=400&fit=crop&crop=entropy", 
    title: "Travel",
    subtitle: "Global Adventures"
  },
];

// Generate many random cards to fill the screen
const generateCards = (count: number) => {
  const cards = [];
  for (let i = 0; i < count; i++) {
    const template = cardTemplates[Math.floor(Math.random() * cardTemplates.length)];
    cards.push({
      id: i + 1,
      img: template.img,
      title: template.title,
      subtitle: template.subtitle,
    });
  }
  return cards;
};

// Generate 120 cards for better spacing and visual appeal
const cards = generateCards(120);

export default function InfiniteCanvas() {
  const [offset, setOffset] = useState({ x: 0, y: 0 });
  const [dragging, setDragging] = useState(false);
  const [start, setStart] = useState({ x: 0, y: 0 });

  // Debug: Log the cards to make sure they're generated
  console.log('Generated cards:', cards.length, cards.slice(0, 3));

  function onMouseDown(e: React.MouseEvent) {
    setDragging(true);
    setStart({ x: e.clientX - offset.x, y: e.clientY - offset.y });
  }
  function onMouseMove(e: React.MouseEvent) {
    if (!dragging) return;
    setOffset({ x: e.clientX - start.x, y: e.clientY - start.y });
  }
  function onMouseUp() {
    setDragging(false);
  }

  return (
    <div
      className="InfiniteCanvas"
      onMouseDown={onMouseDown}
      onMouseMove={onMouseMove}
      onMouseUp={onMouseUp}
    >
      {/* Background Video */}
      <video
        className="background-video"
        autoPlay
        loop
        muted
        playsInline
        onLoadStart={() => console.log('Video loading started')}
        onLoadedData={() => console.log('Video loaded successfully')}
        onError={(e) => console.error('Video error:', e)}
      >
        <source src="/assets/Cloud1.mp4" type="video/mp4" />
        Your browser does not support the video tag.
      </video>
      
      {/* Fallback Animated Cloud Background - only shows if video fails */}
      <div className="animated-clouds-background"></div>
      
      <div
        className="CardGrid"
        style={{ transform: `translate(${offset.x}px, ${offset.y}px)` }}
      >
        {cards.map((c) => (
          <div key={c.id} className="WidgetCard">
            <div 
              className="widget-background"
              style={{ backgroundImage: `url(${c.img})` }}
            />
            <div className="widget-overlay" />
            <div className="widget-content">
              <h3 className="widget-title">{c.title}</h3>
              <p className="widget-subtitle">{c.subtitle}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
